import React, {useState, useEffect} from "react";
//import axios from 'axios';
import QuestionItem from "./questionItem";

const dadosFicticios = [
    {id: 1, title: 'Blockchain developer best practices on innovationchain', body: 'Como centralizar uma divutilizando display, flex'},
    {id: 2, title: 'Como estilizar um button?', body: 'Quero que o botão fique mais bonito'},

]

const QuestionList = () => {
    const [questions, SetQuestions] = useState([]);

    useEffect(() => {
        /*
        const fetchQuestion = async () => {
            try{
                const responde = await axios.get('api)}
                setQuestion(responde.data)
            } catch (error){
                console.log("Error")}
             }

        fetchQuestion();

         */
        SetQuestions(dadosFicticios)
    }, []);

    return (
        <div className="question-list">
            {questions.map(question => (
                <QuestionItem key={question.id} question={question}/>
            ))}
        </div>
    )
};

export default QuestionList;
